import httpClient from "@/utils/httpclient";
import model from "@/components/model";
export default {
    name: "addVehicle",
    components: {
        model
    },
    data() {
        return {
            title: '',
            content: '',
            show: false,
            showB: true,
            vin: '',
            vinIsVaild: false,
            vinSuccess: false,
            data: {},
            year: '',
            make: '',
            trim: '',
            engine: '',
            price: '',
            stock: '',
            condition: 'new',
            odometer: '',
            model: '',
            color: 'Black',
            date: '',
            plate: '',
            photo: ''
        }
    },
    mounted() {

    },
    watch: {
        vin(curVal) {
            if (curVal.length == 17) {
                httpClient.get('/api/v1/vehicle/detail/vin?vin=' + this.vin).then(response => {
                    this.vinIsVaild = false;
                    this.vinSuccess = true;
                    this.showB = false;
                    this.data = response.data.data;
                    this.year = this.data.year;
                    this.make = this.data.make;
                    this.model = this.data.model;
                    this.trim = this.data.trim;
                    this.engine = this.data.engineType;
                    this.price = this.data.price;
                    this.color = this.data.color;
                    this.date = this.data.inventoryDays;
                    this.stock = this.data.stockNumber;
                    this.condition = this.data.vehicleType;
                    this.odometer = this.data.currentMileage/1609.344;
                    this.plate = this.data.plate;
                    this.photo = this.data.photoPath;
                }).catch(error => {
                    this.vinIsVaild = false;
                    this.vinSuccess = true;
                    this.showB = false;
                })
            } else {
                this.vinIsVaild = true;

            }
        }
    },
    methods: {
        closeTip() {
            this.show = false;
        },
        savefile(event) {
            let file = event.target.files;
            let fb = new FormData();
            fb.append("image", file[0]);
            httpClient.post('/api/v1/user/updateAvatar', fb).then(response => {
                if (response.data.code == 200) {
                    this.photo = response.data.data.avatarUrl;
                    this.title = "Success";
                    this.content = "Photo Uploaded Successfully";
                    this.show = true;
                    this.showB = false;
                }
            }).catch(error => {
                console.error(error)
            })
        },
        saveData() {
            httpClient.post('/api/v1/vehicle/insert/vehicle',{
                vin: this.vin,
                year: this.year,
                make: this.make,
                model: this.model,
                trim: this.trim,
                engineType: this.engine,
                color: this.color,
                price: this.price,
                stockNumber: this.stock,
                inventoryDate: new Date(this.date).getTime(),
                vehicleType: this.confidence,
                currentMileage: this.odometer,
                plate: this.plate,
                photoPath: this.photo

            }).then(response => {
                if (response.data.data.bindResult == true) {
                    this.$router.push('/vehicle/detail/' + response.data.data.vehicleId);
                }
            })
        }
    }
}
